import React, {Component} from 'react'
import { CategoryList } from './CategoryList'
import { Link } from 'react-router-dom'

export default class Category extends Component {
    render() {
        const { match } = this.props;
        let rootPath = '';
        const foundedCategory = CategoryList.find(category => category.path === match?.path);
        if (match) {
            rootPath = match.path.split('/');
        }
        return (
            <div>
            <div class="ui inverted menu">
                   <a className> { CategoryList.filter(category => category.CategoryType === rootPath).map(category => (
                            <Link to={category.path} class="item"
                                key={`CATEGORY_LINK_${category.categoryId}`}>
                                {category.categoryName}
                            </Link>
                    ))}
                    </a>
            </div>
            <div>
                <h2 className="ui header">{foundedCategory?.categoryName}</h2>
            </div>
            </div>
        )

    }
}
